var Ninebytes={};Ninebytes.Nexus={};Ninebytes.Nexus.console={};Ninebytes.Nexus.console.DEBUG={level:0,name:"DEBUG"};Ninebytes.Nexus.console.INFO={level:1,name:"INFO"};Ninebytes.Nexus.console.WARN={level:2,name:"WARN"};Ninebytes.Nexus.console.ERROR={level:3,name:"ERROR"};Ninebytes.Nexus.console.FATAL={level:4,name:"FATAL"};Ninebytes.Nexus.console.LOGGING_LEVEL=Ninebytes.Nexus.console.WARN;Ninebytes.Nexus.console.message=function(e,t){if(e.level>=Ninebytes.Nexus.console.LOGGING_LEVEL.level)try{var n="["+new Date+"]["+e.name+"] ";if(t instanceof Object){console.log(n+="Object Output Follows:");console.log(t)}else console.log(n+=t)}catch(r){}};Ninebytes.Nexus.console.debug=function(e){Ninebytes.Nexus.console.message(Ninebytes.Nexus.console.DEBUG,e)};Ninebytes.Nexus.console.info=function(e){Ninebytes.Nexus.console.message(Ninebytes.Nexus.console.INFO,e)};Ninebytes.Nexus.console.warn=function(e){Ninebytes.Nexus.console.message(Ninebytes.Nexus.console.WARN,e)};Ninebytes.Nexus.console.error=function(e){Ninebytes.Nexus.console.message(Ninebytes.Nexus.console.ERROR,e)};Ninebytes.Nexus.console.fatal=function(e){Ninebytes.Nexus.console.message(Ninebytes.Nexus.console.FATAL,e)};